import React from "react";
import { Carousel } from "react-responsive-carousel";
import styled from "styled-components";

function ThirdPage() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 200,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
  };
  return (
    <Container>
      <Carousel {...settings} axis="horizontal">
        <Wrap>
          <a>
            <img src="/images/model-s/tesla-steering.jpg" alt="steering" />
          </a>
        </Wrap>
        <Wrap>
          <a>
            <img src="/images/model-s/screen.jpg" alt="steering" />
          </a>
        </Wrap>
        <Wrap>
          <a>
            <img src="/images/model-s/seats.jpg" alt="steering" />
          </a>
        </Wrap>
        <Wrap>
          <a>
            <img src="/images/model-s/witcher.jpg" alt="steering" />
          </a>
        </Wrap>
      </Carousel>
    </Container>
  );
}

const Container = styled.div`
  height: 150vh;
  background: rgb(0, 0, 0);
`;

const Wrap = styled.div``;
export default ThirdPage;
